$(document).ready(function(){
  $('.rating').click(function(){
    var user_id = $(this).attr('data-user-id');
    var stars = rating._updateRate($(this).val());

    $.ajax({
      type: 'post',
      url: '/users/' + user_id + '/rate',
      data: {rating: stars}
    }); 
  })
})
